isSupported = false;

if (promoBar && promoBarFlag) {
if (promoBarCookie || window.innerWidth < 979) {
promoBar.remove();
} else if (promoBar && !promoBarCookie && !wpUserLoggedIn) {
promoBar.classList.remove('hide');
} else if (typeof headerJs === 'object') {
// check promoBar Network Flag & call promobar fn
headerJs.fnCheckDiscountedPromoBarFlag() ? headerJs.fnCheckDiscountedPromoBarOffer() : promoBar.classList.remove('hide');
promoBarFlag = false;
}
}
// adding try catch for localstorage
try {
isSupported = window.localStorage ? true : false;
} catch (e) {}
if (isSupported) {
if (!localStorage.getItem("cookie-notification-approved") && cookieNotification) {
cookieNotification.classList.remove("hide");
}
}
if (++intS >= 10) {
clearInterval(eTimeVar);
}
}, 100);
} catch (e) {}
</script>
